import React, { Component } from 'react';
import MyComponent from './MyComponent';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: 'Input your name',
      title: 'Input a title'
    };
  }


  render() {
    return (
      <div className="App">
        <MyComponent
          name={this.state.name}
          title={this.state.title}
        />
      </div>
      
    );
  }
}

export default App;
